import React from "react";
import { redirect } from "react-router-dom";
import "./NavBar.css";

class NavBar extends React.Component {
    render() {
        return (
            <div id="navBarContainer">
                <a onClick={redirect("/projects")}>Projects</a>
            </div>
        );
    }
}

export default NavBar;
